fn bubbleSort(arr: []i32) void {
    const n = arr.len;
    for (0..n) |i| {
        for (0..n - i - 1) |j| {
            if (arr[j] > arr[j + 1]) {
                const tmp = arr[j];
                arr[j] = arr[j + 1];
                arr[j + 1] = tmp;
            }
        }
    }
}

